description:
Ilova aholini profilaktika inspektori bilan muloqotdagi ko‘prik hisoblanadi.

Ushbu ilova aholini profilaktika inspektori bilan muloqotdagi ko‘prik hisoblanib, fuqarolar tomonidan yuborilgan arizalar va SOS murojaatlariga tezkorlik bilan munosabat bildirish;

Profilaktika inspektorining aholi tomonidan o'tkaziladigan so'rovnomaga asosan hamda mahallada olib borayotgan ishlariga holisona baho berib borish uchun ishlab chiqildi.
